def find_kth_character(k):
    n = 0
    current_length = 0

    while True:
        n += 1
        current_length += n + 1
        if current_length >= k:
            break

    remaining_length = k - (current_length - (n + 1))
    char_index = (remaining_length - 1) % n

    return chr(ord('a') + char_index)
