                    new_dp[(a, right)] = fat + abs(a - left)
                # Keep left hand on the same key
                if (left, right) not in new_dp or new_dp[(left, right)] > fat:
                    new_dp[(left, right)] = fat
            else:
                # Move right hand to key a
